import Header from "./Header";
import Footer from "./Footer";
import CV from "./CV";
import InputSection from "./InputSection";

function App() {
  return (
    <div className="App">
      <Header></Header>
      <main>
        <InputSection></InputSection>
        <CV></CV>
      </main>
      <Footer></Footer>
    </div>
  );
}

export default App;
